import React, {Component} from "react";
import {BrowserRouter, Route, Switch, Link} from "react-router-dom";

import { MdApps, MdHome, MdPeople, MdNotifications, MdAccountCircle, MdSettings, MdPowerSettingsNew } from "react-icons/md";

import './Sidenav.css'


export default function Sidenav({header, footer, active}){
    return (
        <div className="sidenav--wrapper my-primary-color">
            <ul className="sidenav--header">
                {header.map(
                    ({_id, title, component, active}) => (
                        <li key={`li-link-${_id}`} className={`sidenav-nav-link ${active && "active"}`} >
                            <a href="#">{component}</a>
                        </li>
                    )
                )}

                <li className="sidenav-nav-link"><a href="#stations"><MdApps/></a></li>
                <li className="sidenav-nav-link"><a href="#customers"><MdPeople/></a></li>
                <li className="sidenav-nav-link"><a href="#notifications"><MdNotifications/></a></li>
            </ul>
            <ul className="sidenav--footer">
                <li className="sidenav-nav-link"><a href="#profile"><MdAccountCircle/></a></li>
                <li className="sidenav-nav-link"><a href="#setting"><MdSettings/></a></li>
                <li className="sidenav-nav-link"><a to="/logout"><MdPowerSettingsNew/></a></li>
            </ul>
        </div>
    )
}
